import React, { useEffect, useState } from "react";

const App = () => {
  const [resourceData, setResourceData] = useState(null);

  useEffect(() => {
    // Replace 'your-jwt-token' with the actual JWT token you have
    const jwtToken = "eyJhbGciOiJIUzI1NiIsInR5cCIgOiAiSldUIiwia2lkIiA6ICIxMDUzZmQ2NS1mNTYzLTQzMzEtYmU3MC04NWJmZDJlMWIwZTkifQ..yvycMmN2Mnl7IiHr8dg2DSSk9dvg3VZoTlA0JXyaH54";

    // URL of your Go service's protected resource
    const url = "http://localhost:8000/api/resource";

    // Make the API request with the JWT token in the Authorization header
    fetch(url, {
      headers: {
        Authorization: `Bearer ${jwtToken}`,
      },
    })
      .then((response) => {
        if (!response.ok) {
          throw new Error("Network response was not ok");
        }
        return response.json();
      })
      .then((data) => {
        setResourceData(data.data);
      })
      .catch((error) => {
        console.error("Error fetching data:", error);
      });
  }, []);

  return (
    <div>
      <h1>Hello, world!</h1>
      <p>Resource Data: {resourceData}</p>
    </div>
  );
};

export default App;
